script: |
  super -f text -I q9301.spq | sort > q9301.out

inputs:
  - name: q9301.spq
    data: |
      SELECT - col0 / + 56, - ( col0 ) AS col2 FROM tab1 (FORMAT parquet) WHERE NOT ( NOT 37 * + col0 * col2 + col1 + + - 84 IS NOT NULL );
  - name: tab1

outputs:
  - name: q9301.out
    data: |
      -1	-85
      -1	-91
      0	-51
